import { Card } from "../Card/Card";

export const List = ({ listTransactions }) => {
  return (
    <section className="List">
      <div className="resume-block">
        <p className="resume">Resumo financeiro</p>
        <div>
          <button className="button-all">Todos</button>
          <button className="button-entrance">Entradas</button>
          <button className="">Despesas</button>
        </div>
      </div>
      <ul>
        {listTransactions.map((transaction, index) => (
          <li>
            <Card transaction={transaction} key={index} />
          </li>
        ))}
      </ul>
    </section>
  );
};
